import {StyleSheet, Text, View, TouchableOpacity} from "react-native";
import {LinearGradient} from "expo-linear-gradient";

export default function App() {
  return (
    <View style={styles.container}>
        <LinearGradient colors={["#904e95", "#e96443"]} style={styles.linearGradient} start={[0.2,0]} end = {[0,1]} />
        <View style={styles.titleContainer}>
          <Text style={styles.titleText}>Beginners?</Text>
          <Text style={styles.text}>See what we can do for you.</Text>
        </View>
        <View style={styles.buttonBox}>
          <View style={styles.button}>
              <TouchableOpacity>
                <Text style={styles.Buttontext}>OK</Text>
              </TouchableOpacity>
          </View>
        </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    fontFamily: "sf compact text",
  },

  titleContainer: {
    paddingLeft: "30px",
    paddingTop: "75px"

  },

  titleText: {
    color: "#fff",
    fontSize: "50px",
    fontWeight: "700",
    letterSpacing: "1px",
  },

  text: {
    color: "#fff",
    fontSize: "17px",
    marginTop: "2px"
  },

  buttonBox: {
    width: "100%",
    alignItems: "center",
    position: 'absolute',
    bottom: "150px",
  },

  button: {
    width: "250px",
    borderRadius: "5px",
    backgroundColor: "#0263FF",
    color: "white",
    alignItems: "center"
  },

  buttonText: {
    alignItems: "center"
  },

  linearGradient: {
    zIndex: -1,
    position: "absolute",
    left: 0,
    right: 0,
    top: 0,
    height: "100%"
  }

});
